import Header from "../components/Header";

function HomePage({}) {
  return (
    <div>
      <Header />
      <section className="cart-section grid grid-cols-2">
        <article className="w-24 h24">1</article>
        <article className="w-24 h24">2</article>
        <article className="w-24 h24">3</article>
        <article className="w-24 h24">4</article>
        <article className="w-24 h24">5</article>
      </section>
    </div>
  );
}

export default HomePage;
